description:
Tracks 1 to 3 - taken from the legendary release called &quot;The Soundhouse Tapes&quot;
Tracks 4 to 9 - taken from very rare Japanese release called &quot;Live + One&quot;
Tracks 10 to 15 - recorded live in Japan during the first japanese tour
Track 16 - Non European release, Nagoya 23.5.81
Track 17 - released by mistake on 1st LP-release of &quot;Axe Attack&quot;
Track 18 - 1979 Demo, Doug Sampson on drums
Track 19 - Deep Purple cover-version, live Posnen 11.8.8

Ripped at 320 from my original press Cd, with scanned artwork
